import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        React Reading List
      </a>
      <a className="nav mavbar-nav" href="/saved">Saved Books</a>
    </nav>
  );
}

export default Nav;
